Agent Orange was one of the deadly products of the classified U.S. biological and chemical weapons program called "Project 112/Project SHAD".Â This dangerous chemical was used in the Vietnam War to completely destroy vegetation in the jungles. In addition to environmental damage, Agent Orange contains Dioxin which can cause cancer, birth defects and, in many cases, death. 

From 1966-67, field tests of this toxin were sprayed on a slope of Mauna Loa near Hilo and in parts of Kapaa, Kauai. Other testing sites were the release of nerve gas in the Waiakea Forest on the Big Island and the release of biological simulants on Oâ€™ahu. 

Many U.S. soldiers were unknowingly exposed to Agent Orange and up to 4 million people were exposed to it in Vietnam. To this day, the United States military has failed to take responsibility for this brutal chemical warfare including the damage it has done in Hawaii, which is US claimed land. 

Photo is of Vietnam, via Wikipedia. 

